$(document).ready(function(){$("[data-bs-hover-animate]").mouseenter(function(){var t=$(this);t.addClass("animated "+t.attr("data-bs-hover-animate"))}).mouseleave(function(){var t=$(this);t.removeClass("animated "+t.attr("data-bs-hover-animate"))}),$("[data-bs-chart]").each(function(t,a){this.chart=new Chart($(a),$(a).data("bs-chart"))})}),$(function(){$(".fancybox").fancybox({helpers:{title:{type:"inside"}}})}),$("[data-toggle=tooltip]").tooltip(),$(document).ready(function(){$(".navbar-toggler").on("click",function(){$("body").toggleClass("navbar--opened")})}),$("#menu-toggle").click(function(t){t.preventDefault(),$("#wrapper").toggleClass("toggled")});